<title>shuffle images</title>

<style>
body { background-color: black;}
html {height: 100%;  overflow:   scroll;}
::-webkit-scrollbar { width: 0px; background: transparent;}
body {margin: auto; width: 100%; background-color: #000000; color: #20C030; vertical-align:middle;}
img { width: 100%; display: block; margin-left: auto; margin-right: auto;  vertical-align:middle;}
</style>

</head>
<body onkeypress="chkKey()">
<div class="imagearea" style="vertical-align:middle;"> </div>

<script>
function chkKey() {
  var testkey = getChar(event);
  if(testkey == 'b'){ backward();}
  if((testkey == 'f')|(testkey == ' ')){ foreward();}
  if(testkey == '-'){ backward();}
  if(testkey == '+'){ foreward();}
  if(testkey == 'r'){ randomflip();}
  if(testkey == 'p'){ pause();}
  if(testkey == 'c'){ continU();}
}

function getChar(event) {
  if (event.which!=0 && event.charCode!=0) {

    return String.fromCharCode(event.which)
  } else {
    return null // special key
  }
}

        ImgList[i] = ImgList[j]; ImgList[j] = temp;
    }
    return ImgList;
}

function changeImg() {
	if (listLen >= ImgList.length - 1) {

};

}
